import React from 'react';

const List = ({people}) => {
  return (
    <>

     {people.map(person => (
       <article key={people.id}>
         <img src={people.image} alt={people.name}/>
         <div>

         </div>
       </article>
     ))}
    </>
  );
};

export default List;
